INSERT INTO `youtube_channel_details` (`channel_id`, `title`, `channel_img`, `desc`, `subscriberCount_gained`, `subscriberCount_lost`, `business_email`, `total_100video_views`, `total_100video_views_unique`, `total_100video_likes`, `total_100video_dislikes`, `total_100video_comments`, `total_100video_shares`, `facebook_url`, `insta_url`, `twitter_url`, `country`) VALUES
('UCFmaQ3okrfyHcDElrf2gGtg', 'AdwokaciZwierzat', 'https://yt3.ggpht.com/a-/AN66SAxJt_-gLueaLE8IegnDHa8CjTjHg5kOFgJF7Q=s240-mo-c-c0xffffffff-rj-k-no', 'ADWOKACI ZWIERZĄT - PROGRAM, JAKIEGO W POLSCE JESZCZE NIE BYŁO! \n\nJesteśmy ludźmi czynnie zaangażowanymi w ochronę i pomoc zwierzętom. Nie godzimy się na ich okrutne traktowanie. Tym mocniej boli nas fakt ignorowania ich praw przez polski wymiar sprawiedliwości. Jest to program naszej rodzimej produkcji, choć wykorzystamy niektóre materiały filmowe zagranicznych organizacji, to jednak nie jest on na żadnej licencji, żadną kopią zagranicznej produkcji. ORYGINALNY POLSKI PROGRAM, na który pomysł narodził się wiosną 2010 r. \n\nCzy kierujemy nasz projekt do miłośników zwierząt? Nie tylko. \nDo kogo głównie kierujemy nasz projekt? Do osób jedzących mięso i inne produkty pochodzenia zwierzęcego, do osób nieświadomych okrucieństwa wobec zwierząt oraz unikających tego tematu, do producentów żywności, kosmetyków, leków, odzieży, tytoniu i alkoholu, do Władz RP, do osób i instytucji zaangażowanych w ochronę i eksploatację dzikiej przyrody, a także do wszystkich czynnie lub biernie zaangażowanych w różne inne formy eksploatacji zwierząt i środowiska naturalnego. \n\nBohaterami będą zwierzęta, obrońcy zwierząt oraz ludzie zajmujący się ochroną przyrody, a także przedstawiciele polskiego show-biznesu, polskiej sceny politycznej oraz adwokaci, prawnicy i sędziowie. Chcemy podejść do problemu ochrony praw zwierząt w Polsce w sposób kompleksowy, a zarazem ciekawy, ekscytujący i przystępny dla widzów z różnych środowisk społecznych.\n\nProgram inny niż wszystkie. Będziemy mówić o problemach wszystkich zwierząt: Zwierzęta w rolnictwie, Zwierzęta jako towarzysze człowieka, Zwierzęta w sporcie, rozrywce i rekreacji, Dzika przyroda, Zdrowie, moda i uroda bez okrucieństwa. \n\nZorganizowaliśmy ogromną akcję na portalach społecznościowych. Projekt błyskawicznie zdobył ogromne poparcie w ciągu krótkiego czasu. Ponad 100 osób dziennie zapisuje się na nasze strony, wysyła do nas zaproszenia oraz zapisuje sie do naszych grup dyskusyjnych.\n\nW poszczególnych odcinkach programu będziemy filmować akcje podczas interwencji oraz pomocy przy zwierzętach. Znane osoby wezmą udział w tych akcjach jako osoby towarzyszące, przyglądające się, komentujące sytuację lub w razie możliwości pomagające w opiece nad zwierzętami oraz uczestniczące w zabawach z nimi. Zostaną zaproszeni m.in. do schronisk i ośrodków rehabilitacji lub gospodarstw, gdzie dobrostan zwierząt jest najważniejszy. Wszystko w zależności od profilu edycji. Zamierzamy pokazać relacje z przebiegu leczenia i rehabilitacji zwierząt z udziałem lekarzy weterynarii i rehabilitantów w placówkach dla zwierząt. Zaprosimy osoby z różnych środowisk społecznych, aby wyraziły swoje opinie na temat sytuacji zwierząt w Polsce.', 8, 0, '', 1532, 0, 5, 2, 0, 0, '', '', '', ''),
